for=\"c1\"><span></span><br>Agrega a mi Cotización</label>\n                        </form>\n                    </div>\n                    <div class=\"large-3-custom text-center columns checkbox-row\">\n                        <form class=\"checkbox-form\" action=\"#\">\n                            <input id=\"c2\" type=\"checkbox\"><label for=\"c2\"><span></span><br>Agrega a mi Cotización</label>\n                        </form>\n                    </div>\n                    <div class=\"large-3-custom text-center columns checkbox-row\">\n                        <form class=\"checkbox-form\" action=\"#\">\n                            <input id=\"c3\" type=\"checkbox\"><label for=\"c3\"><span></span><br>Agrega a mi Cotización</label>\n                        </form>\n                    </div>\n                    <div class=\"large-3-custom text-center columns checkbox-row\">\n                        <form class=\"checkbox-form\" action=\"#\">\n                            <input id=\"c4\" type=\"checkbox\"><label for=\"c4\"><span></span><br>Agrega a mi Cotización</label>\n                        </form>\n                    </div>\n                </div> -->\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"large-9 large-centered medium-10 medium-centered small-10 small-centered columns\">\n                <div class=\"row total\">\n                    <div class=\"large-4 columns medium-4 text-center total-left\">\n                        <p>TOTAL PRIMA MENSUAL</p>\n                        <p id=\"suma\">S/.50</p>\n                    </div>\n                    <div id=\"message\" class=\"large-8 columns medium-8 total-right\">\n                        <p>AGREGA LA COBERTURA DE <b>PÉRDIDA TOTAL X ROBO</b> Y LLÉVATE GRATIS <b>NUESTRA COBERTURA DE ASISTENCIA</b> VIAL. <a href=\"#\" data-reveal-id=\"asistencia-vial\">ver más</a></p>\n                    </div>\n                </div>\n            </div>\n        </div>\n\n        <!-- <div class=\"row\">\n            <div class=\"large-9 large-centered small-11 small-centered text-center columns\">\n                <p class=\"marketing\">DESCARGA TU COTIZACIÓN Y LLÉVALA AL PUNTO DE VENTA MÁS CERCANO</p>\n            </div>\n        </div> -->\n\n        <div class=\"row\">\n            <div class=\"large-9 large-centered small-10 small-centered columns text-center\">\n                <div class=\"row\" id=\"radio\">\n                    <div class=\"large-6 small-12 medium-6 columns\">\n                        <input id=\"contact-option-1\" type=\"radio\" name=\"contact-radio\" value=\"contact-1\">\n                        <label class=\"radio-label\" for=\"contact-option-1\">Realizar cotización en línea.</label>\n                    </div>\n                    <div class=\"small-12 columns show-for-small-only\"><p class=\"radio-middle\">ó</p></div>\n                    <div class=\"large-6 small-12 medium-6 columns\">\n                        <input id=\"contact-option-2\" type=\"radio\" name=\"contact-radio\" value=\"contact-2\">\n                        <label class=\"radio-label\" for=\"contact-option-2\">Contáctenme por teléfono.</label>\n                    </div>\n                </div>\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div id=\"contact\" class=\"large-6 large-uncentered medium-6 medium-uncentered small-10 small-centered columns\">\n                <form id=\"contact-form\" type=\"POST\" action=\"/content/gracias\">\n                    <div class=\"row\">\n                        <div class=\"large-6 columns\">\n                            <input type=\"text\" name=\"name\" placeholder=\"Nombre\" required>\n                        </div>\n                        <div class=\"large-6 columns\">\n                            <input type=\"text\" name=\"surname\" placeholder=\"Apellido\" required>\n                        </div>\n                    </div>\n                    <div class=\"row\">\n                        <div class=\"large-12 columns\">\n                            <input type=\"text\" name=\"email\" placeholder=\"Correo Electrónico\" required>\n                        </div>\n                    </div>\n                    <div class=\"row\">\n                        {exp:get_post_vars parse=\"inward\"}\n                        <div class=\"large-12 columns\">\n                            <input type=\"text\" name=\"phone\" placeholder=\"Teléfono\">\n                            <input type=\"hidden\" name=\"brand\" value=\"{get_marca}\">\n                            <input type=\"hidden\" name=\"model\" value=\"{get_modelo}\">\n                            <input type=\"hidden\" name=\"ano\" value=\"{get_ano}\">\n                            <input type=\"hidden\" name=\"version\" value=\"{get_version}\">\n                            <input type=\"hidden\" name=\"precio\" value=\"{get_precio}\">\n                            <input id=\"tipo_respci\" type=\"hidden\" name=\"tipo_respci\">\n                            <input id=\"respci\" type=\"hidden\" name=\"respci\">\n                            <input id=\"ptr\" type=\"hidden\" name=\"ptr\">\n                            <input id=\"c3_form\" type=\"hidden\" name=\"ptch\">\n                            <input id=\"c4_form\" type=\"hidden\" name=\"dpch\">\n                            <input id=\"suma_form\" type=\"hidden\" name=\"total_prima\">\n                        </div>\n                        {/exp:get_post_vars}\n                    </div>\n                    <!--\n                    <div class=\"row\">\n                        <div class=\"large-12 columns\">\n                            <input id=\"checkbox1\" type=\"checkbox\"><label for=\"checkbox1\"><span></span>Enviar copia de la cotización a mi correo</label>\n                        </div>\n                    </div>\n                    <div class=\"row\">\n                        <div class=\"large-12 columns\">\n                            <input id=\"checkbox2\" type=\"checkbox\"><label for=\"checkbox2\"><span></span>Quiero que me contacten por teléfono</label>\n                        </div>\n                    </div>\n                    -->\n                    <div class=\"row\">\n                        <div class=\"large-8 small-8 small-centered columns\">\n                            <button id=\"form_button\" class=\"button-orange\" type=\"submit\">DESCARGAR COTIZACIÓN EN PDF</button>\n                        </div>\n                    </div>\n               </form>\n            </div>\n\n            <div id=\"locate\" class=\"large-5 large-uncentered medium-5 medium-uncentered small-10 small-centered columns\">\n                <div class=\"row\">\n                    <div class=\"large-12 columns\">\n                        <p class=\"marketing locate\">UBICA EL PUNTO DE VENTA MÁS CERCANO</p>\n                    </div>\n                </div>\n                <div class=\"row\">\n                    <form id=\"locate-form\" action=\"#\">\n                        <div class=\"large-6 columns\">\n                            <span class=\"selector\">\n                                   {exp:filtros:region}\n                            </span>\n                        </div>\n                        <div class=\"large-6 columns\">\n                            <span class=\"selector\">\n                                <select name=\"distrito\" id=\"distrito\">\n                                   {exp:filtros:district region=\"@@@\"}\n                                </select>\n                            </span>\n                        </div>\n                    </form>\n                </div>\n                <div class=\"row\">\n                    <div class=\"large-12 columns\">\n                        <p id=\"locate-msg\">TU AGENCIA MÁS CERCANA ES:</p>\n                        <div id=\"result\" class=\"result\">\n                            <p>Agencia Miraflores</p>\n                            <p>Avenida Jorge Chávez #154, oficina 201</p>\n                            <p>Miraflores, Lima </p>\n                            <!-- <a href=\"#\">ver mapa</a> -->\n                        </div>\n                    </div>\n                </div>\n            </div>\n        </div>\n   </section>\n\n{embed=\"includes/footer\"}\n'),(101,19,'exp_templates','template_data',1401915381,1,'<div id=\"perdida-robo\" class=\"reveal-modal\" data-reveal>\n    <p class=\"lead\"><b>Pérdida Total por Robo:</b></p>\n    <p>Esta cobertura cubre el valor comercial del vehículo en caso este sea robado.</p>\n    <p>Los daños sufridos por el vehículo a causa de un robo deben ser equivalentes al 75% o más del valor nuevo del vehículo asegurado o de uno similar en sus características técnicas en la fecha de ocurrido el siniestro.</p>\n    <p class=\"italic\">Deducible: 10% del monto indemnizable.</p>\n    <a class=\"close-reveal-modal\">&#215;</a>\n</div>\n\n<div id=\"perdida-choque\" class=\"reveal-modal\" data-reveal>\n    <p class=\"lead\"><b>Pérdida Total por Choque:</b></p>\n    <p>Esta cobertura cubre el valor comercial del vehículo en caso de choque.</p>\n    <p>Los daños sufridos por el vehículo a causa de un accidente deben ser equivalentes al 75% o más del valor nuevo del vehículo asegurado o de uno similar en sus características técnicas en la fecha de ocurrido el siniestro.</p>\n    <p class=\"italic\">Deducible: 10% del monto indemnizable.</p>\n    <a class=\"close-reveal-modal\">&#215;</a>\n</div>\n\n<div id=\"propio-choque\" class=\"reveal-modal\" data-reveal>\n    <p class=\"lead\"><b>Daño Propio por Choque:</b></p>\n    <p>Esta cobertura cubre la reparación del vehículo asegurado en caso de choque hasta por S/. 30,000.</p>\n    <p>La cobertura es aplicable sólo a talleres multimarcas autorizados por La Positiva. Esta cobertura también se extiende a cubrir los daños del vehículo de un tercero causados por el vehículo asegurado hasta por el monto de la suma asegurada.</p>\n    <p class=\"italic\">Deducible: 8% de la suma asegurada.</p>\n    <a class=\"close-reveal-modal\">&#215;</a>\n</div>\n\n<div id=\"responsabilidad-civil\" class=\"reveal-modal\" data-reveal>\n    <p class=\"lead\"><b>Responsabilidad Civil:</b></p>\n    <p>Esta cobertura cubre la Responsabilidad Civil en que incurra el Asegurado o cualquier otra persona que conduzca el vehículo asegurado con su autorización, que sea consecuencia de un accidente y que ocasione lesiones y/o daños materiales a personas o cosas que se encuentren fuera del vehículo, hasta la suma asegurada contratada.</p>\n    <p class=\"italic\">Deducible: 10% del monto indemnizable, mínimo S/. 300.</p>\n    <a class=\"close-reveal-modal\">&#215;</a>\n</div>\n\n<div id=\"terms\" class=\"reveal-modal\" data-reveal>\n    <h4 class=\"text-center\"><b>Términos y Condiciones</b></h4>\n<h4 class=\"text-center\">Unidades Asegurables</h4>\n\n<p>Las clases de vehículos para este programa son Vehículos Livianos tales como Automóviles, Camionetas Station Wagon, Camionetas SUV (Rurales Hasta 9 Asientos) y Camionetas Pick Up (*)</p>\n<p>(*) Las Camionetas Pick Up solo podrán asegurarse bajo la cobertura Responsabilidad Civil</p>\n\n<h4 class=\"text-center\">Condiciones</h4>\n\n<p>Uso - Programa exclusivo para Uso Particular.</p>\n\n<p>Antigüedad - Válido para vehículos Livianos hasta 20 años de antigüedad.</p>\n\n<p>Valor Comercial - Programa válido para Vehículos Livianos cuyo valor comercial se encuentre entre los precios S/. 15,000 a S/. 45,000 o su equivalente en dólares (según tipo de cambio vigente)</p>\n\n<h4 class=\"text-center\">Vehículos No Asegurables</h4>\n\n<p>Todo Vehículo Liviano cuyo valor comercial supere los S/. 45,000 o su equivalente en dólares (según tipo de cambio vigente)</p>\n\n<p>Todo Vehículo Liviano que supere los 20 años de antigüedad.</p>\n\n<p>Los siguientes vehículos hasta 3 años de antigüedad (nuevos al 2011) no podrán ser asegurados bajo la cobertura Pérdida Total por Robo.</p>\n\n<ul>\n<li>CHEVROLET Aveo.</li>\n<li>HONDA CRV.</li>\n<li>MAZDA 3.</li>\n<li>MITSUBISHI en sus modelos Montero, Nativa y Pajero.</li>\n<li>NISSAN en sus modelos Sentra, Tiida.</li>\n<li>SUBARU Impreza.</li>\n<li>SUZUKI Grand Nomade.</li>\n<li>TOYOTA en sus modelos Yaris, Corolla, Rav4, FJ Cruiser, Fortuner, 4Runner, Land Cruiser y Land Cruiser Prado.</li>\n<li>VOLKSWAGEN Bora.</li>\n</ul>\n\n<p>Los siguientes vehículos no podrán ser asegurados bajo la cobertura Pérdida Total Por Robo, </p>\n\n<p>Pérdida Total Por Choque y Daños Por Choque.</p>\n\n<ul>\n<li>AUDI R8.</li>\n<li>BMW ActiveHybrid.</li>\n<li>CHEVROLET Camaro.</li>\n<li>DOGDE en sus modelos Challenger, Charger, Nitro y Ram.</li>\n<li>FERRARI en todos sus modelos.</li>\n<li>FORD Mustang.</li>\n<li>HONDA Hybrid.</li>\n<li>HYUNDAI en sus modelos Coupe, Eclipse, Genesis, Genesis Coupe, Tiburón, Veloster.</li>\n<li>HUMMER en todos sus modelos.</li>\n<li>INFINITY en todos sus modelos.</li>\n<li>JAGUAR en todos sus modelos.</li>\n<li>LEXUS en todos sus modelos.</li>\n<li>MAZDA en sus modelos MX-5, RX (cualquier versión)</li>\n<li>MINI COOPER en todos sus modelos.</li>\n<li>MITSUBISHI en sus modelos Diamante, Eclipse, Evolution, Lancer Evolution (cualquier versión), 3000, 3000GT.</li>\n<li>NISSAN en sus modelos Lucino, Skyline, 240, 280, 350Z, 370Z.</li>\n<li>OPEL VITA en todos sus modelos.</li>\n<li>PORSCHE en todos sus modelos.</li>\n<li>PEUGEOT en sus modelos Cabriolet, CC y GTI.</li>\n<li>SEAT en sus modelos Ibiza y León en cualquier versión FR y Cupra.</li>\n<li>SUBARU en sus modelos BRZ, Impreza GT, Impreza Turbo, Impreza STI, Impreza STI WRX e Impreza WRX (cualquier versión).</li>\n<li>TOYOTA en sus modelos Celica, Chaser, Corolla GT, Corona Exiv, Cresta, Curren, Cynos, Estima (Lucida y Emina), Hachiroku, Mark II, Paseo, Prius Probox, Scion, Sienta, Soarer, Supra, Succeed, Vista, 86GT.</li>\n<li>VOLKSWAGEN GTI.</li>\n<li>Vehículos Descapotables (Convertibles).</li>\n<li>Vehículos Híbridos.</li>\n<li>Vehículos con puertas de apertura vertical (LSD Doors).</li>\n<li>Cualquier vehículo de competencia o preparado para competir.</li>\n</ul>\n\n<h4 class=\"text-center\">Exclusiones</h4>\n<ol>\n<li>Falta de licencia de conducir y/o cuando el Asegurado comete infracción MUY GRAVE según el Reglamento Nacional de Tránsito.</li>\n<li>Conducción bajo los efectos de alcohol y drogas.</li>\n<li>Daños a terceros cuando el vehículo haya sido robado.</li>\n<li>Daños a cónyuge y a parientes del Asegurado, sólo para el caso de responsabilidad civil. \n<p>Daños intencionales.</p>\n</li>\n<li>Daños a terceros cuando el vehículo es dedicado a la enseñanza de conducción o participación en competencias automovilísticas.\n<li>Daños cuando el vehículo tiene un uso distinto al particular.</li>\n<li>Responsabilidad penal.</li>\n<li>Guerra civil o internacional, contaminación radioactiva.\n<p>Disposiciones Finales</p>\n</li>\n</ol>\n\n<ol>\n<li>El deducible a cargo del Asegurado se aplicará por todo y cada reclamo y no incluye el Impuesto General a las Ventas (IGV).</li>\n<li>La información aquí proporcionada es a título parcial. Prevalecen las Condiciones Particulares sobre las Condiciones Generales de la Póliza de Seguro de Vehículos, la cual está disponible en: www.lapositiva.com.pe.</li>\n<li>El Asegurado tiene derecho a solicitar a La Positiva, copia de la Póliza de Seguro de Vehículos, la cual deberá ser entregada en un plazo máximo de quince (15) días calendario desde la recepción de la solicitud presentada por el Asegurado.</li>\n<li>La cobertura de esta póliza será la que corresponda al de la prima pagada.</li>\n<li>La relación de talleres multimarca encargados de la reparación del vehículo asegurado así como la lista de vehículos NO ASEGURABLES bajo esta póliza, se encuentra disponible en: www.lapositiva.com.pe. </li>\n<li>La existencia de dos o más pólizas cubriendo el mismo riesgo implica la aplicación del artículo 90 de la Ley del Contrato de Seguro.</li>\n<li>El incumplimiento de las obligaciones a cargo del Asegurado, podría afectar el pago de un siniestro al que tendría derecho.</li>\n<li>El Asegurado se encuentra obligado a informar a La Positiva cualquier hecho o circunstancia que agrave el riesgo asegurado.</li>\n<li>El vehículo asegurado en esta póliza no requiere inspección, por lo que el Asegurado mediante la firma de esta póliza declara bajo juramento la tenencia del vehículo al momento de la afiliación al seguro, así como el buen estado del mismo bajo las condiciones de operatividad establecidas por el fabricante.</li>\n<li>El Asegurado podrá resolver esta póliza de seguro sin expresión de causa, dentro de los quince (15) días, contados desde que la recibe. En caso de que esta póliza sea contratada a través de un comercializador autorizado por La Positiva, éste derecho se puede ejercer en las oficinas donde se contrató. En caso el Asegurado ejerza su derecho de arrepentimiento luego de pagada la prima o parte de la misma, La Positiva procederá a la devolución total de la prima pagada.</li>\n<li>El Asegurado autoriza a La Positiva el envío de toda la información vinculada a la póliza de seguro que ha adquirido, a la dirección electrónica consignada en este documento.</li>\n</ol>\n\n<h4 class=\"text-center\">Resumen Informativo del Seguro de Vehículos</h4>\n\n<p>Riesgos Cubiertos</p>\n\n<p>Cubre los riesgos especificados en el inciso 4 Coberturas y Sumas Aseguradas de las Condiciones </p>\n\n<h4 class=\"text-center\">Particulares de la Póliza</h4>\n\n<p>Inicio de la Cobertura</p>\n\n<p>De conformidad con lo estipulado en el segundo párrafo del artículo 4º de la Ley Nº29946, Ley del Contrato de Seguro, las partes acuerdan postergar el inicio de la cobertura del seguro al pago de la primera cuota fraccionada o de la cuota anual de la prima dentro del plazo establecido, siempre que no se haya pactado un plazo adicional para dicho pago.</p>\n\n<p>Sin perjuicio de lo anterior, en la eventualidad de la ocurrencia de un siniestro antes del plazo acordado para el pago de la primera cuota o de la cuota anual de la prima, La Positiva deberá cubrir el pago del siniestro, oportunidad en la cual se devengará la prima debida de acuerdo al convenio de pago suscrito, la cual será descontada del importe de la indemnización correspondiente. En caso de un siniestro considerado pérdida total, se devengará el íntegro de la prima acordada, que será descontada del importe de la indemnización correspondiente.</p>\n\n<h4 class=\"text-center\">Exclusiones</h4>\n\n<p>Son las que se indican en el inciso 7 Principales exclusiones de las Condiciones Particulares de la Póliza así como en el Capítulo IV Exclusiones del Seguro de las Condiciones Generales de la Póliza de Seguro de Vehículos y en las respectivas Cláusulas Adicionales, de ser el caso.</p>\n\n<h4 class=\"text-center\">Causales de Resolución del Contrato</h4>\n\n<p>Se encuentran señaladas en el numeral 2.2 Inicio de Cobertura, el numeral 2.3 Pago de Primas y en el numeral 2.10 Resolución de Contrato de Seguro de las Condiciones Generales de la Póliza de Seguro de Vehículos.</p>\n\n<h4 class=\"text-center\">Medio y Plazo Establecidos para el Aviso del Siniestro</h4>\n\n<p>Los siniestros deben ser avisados a través de Línea Positiva llamando al 211-0-211 desde Lima o al 74-9000 desde provincias (si llama desde celular deberá marcar previamente el código de la provincia donde se encuentre), dentro de las 72 horas de ocurrido el siniestro.</p>\n\n<p>La omisión o el retardo sólo son excusables si medió fuerza mayor, caso fortuito o imposibilidad de hecho sin culpa o negligencia. Se deja expresa constancia que lo consignado en el presente numeral, en ningún caso limita el derecho del Asegurado de acudir a cualquier instancia judicial o administrativa, si así lo considerara pertinente.</p>\n\n<h4 class=\"text-center\">Procedimiento para la Atención del Siniestro</h4>\n\n<p>Ocurrido el siniestro, el Asegurado deberá presentar el reclamo a La Positiva, o a través del Comercializador autorizado si fuera el caso, entregando los documentos que acrediten la ocurrencia del siniestro y el importe de los daños sufridos.</p>\n\n<h4 class=\"text-center\">Lugares para la Atención del Siniestro</h4>\n\n<p>Los siniestros serán atendidos en las oficinas de La Positiva, cuyas direcciones aparecen en www.lapositiva.com.pe.</p>\n\n<h4 class=\"text-center\">Mecanismos de Solución de Controversias</h4>\n\n<p>Las controversias se solucionarán de acuerdo a lo indicado en el numeral 2.17 Solución de Controversias, de las Condiciones Generales de la Póliza de Seguro de Vehículos.</p>\n\n<h4 class=\"text-center\">Áreas Encargadas de Atender Reclamos</h4>\n\n<p>La Positiva recibirá los reclamos de los Asegurados en su “Área de Servicio al Cliente” llamando al 211-0-211 desde Lima o al 74-9000 desde provincias (si llama desde celular deberá marcar previamente el código de la provincia donde se encuentre), ó en cualquiera de sus oficinas a nivel nacional cuyas direcciones aparecen en www.lapositiva.com.pe, así como a través de la misma página web de La Positiva.</p>\n\n<h4 class=\"text-center\">Instancias habilitadas para presentar reclamos y/o denuncias</h4>\n\n<p>El Asegurado también podrá realizar cualquier reclamo sobre los alcances de este seguro en la “Defensoría del Asegurado”, llamando al 446-9158 o visitando sus oficinas en Calle Arias Aragüez N° 146 Miraflores - Lima o a través de www.defaseg.com.pe, así como también en la Plataforma de Atención al Usuario de la Superintendencia de Banca, seguros y AFP’s o en INDECOPI, entre otros, según corresponda.</p>\n\n<h4 class=\"text-center\">Tratamiento de Datos Personales</h4>\n\n<p>El Asegurado autoriza de forma expresa a La Positiva Seguros y Reaseguros, el uso de los datos personales proporcionados en la contratación del presente seguro, para fines comerciales, tales como el envío de publicidad y promociones de diferentes productos o servicios; autorización que se extiende en el marco de lo dispuesto en la Ley Nº 29733 y su Reglamento, aprobado por Decreto Supremo Nº 003-2013, que regula el tratamiento de datos personales y la posibilidad de que La Positiva Seguros y Reaseguros transfiera los mismos a sus empresas vinculadas y/o terceros con los que ésta mantenga una relación contractual.</p>\n    <a class=\"close-reveal-modal\">&#215;</a>\n</div>\n\n<div id=\"info\" class=\"reveal-modal\" data-reveal>\n    <p class=\"lead\"><b>Your couch.  It is mine.</b></p>\n    <p>Im a cool paragraph that lives inside of an even cooler modal. Wins</p>\n    <p class=\"lead\"><b>A nice subtitle.</b></p>\n    <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Dolore, eaque, nam facilis voluptates quia rerum quae tenetur porro unde non magni distinctio saepe quasi expedita neque ea consequatur autem quo.</p>\n    <p class=\"lead\"><b>A nice subtitle.</b></p>\n    <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Dolore, eaque, nam facilis voluptates quia rerum quae tenetur porro unde non magni distinctio saepe quasi expedita neque ea consequatur autem quo. Lorem ipsum dolor sit amet, consectetur adipisicing elit. Eos, similique, obcaecati, dolores recusandae aspernatur vel voluptas soluta magnam totam asperiores quod voluptatem nam? Eius, ipsum, rerum beatae doloremque aut modi!</p>\n    <a class=\"close-reveal-modal\">&#215;</a>\n</div>\n\n<div id=\"pack-total\" class=\"reveal-modal\" data-reveal>\n    <p class=\"lead\"><b>Auto Total Positiva:</b></p>\n    <p>El valor comercial de tu auto está por encima de la suma asegurable de nuestro producto Pack Vehicular, para lo cual te ofrecemos nuestro producto integral Auto Total Positiva, el cual permite asegurar tu auto contra todo riesgo.</p>\n    <p>Para más información sobre el producto haz <a href=\"#\">click aquí</a>.</p>\n</div>\n\n<div id=\"accidentes-personales\" class=\"reveal-modal\" data-reveal>\n    <p>El seguro de Accidentes personales cubre:</p>\n    <br>