ura de Asistencia Vial cubre:</p>\n    <br>\n    <p><b>a)</b> Servicio de Auxilio Mecánico: Llaves en el interior, cambio de llanta, se quedó sin gasolina, recarga de batería.</p>\n    <p><b>b)</b> Servicio de Remolque (para vehículos de un máximo de 20 toneladas): Auto no enciende, no tienen llanta de repuesto, choque, etc.</p>\n    <p><b>c)</b> Chofer de reemplazo: Este servicio es válido solo para vehículos livianos en Lima Metropolitana.</p>\n</div>\n{embed=\"includes/footer\"}'),(53,24,'exp_templates','template_data',1391030670,2,''),(54,25,'exp_templates','template_data',1391030697,2,''),(55,18,'exp_templates','template_data',1393531122,2,'{if segment_1!=\'\' AND last_segment!=\'gracias\' AND last_segment!=\'gracias_phone\'}\n	<div class=\"row volver-cotizar\">\n	    <div class=\"medium-centered medium-4 medium-centered small-8 small-centered columns\">\n	    	<a href=\"{site_url}\"><button class=\"button-orange-claro large\">VOLVER A COTIZAR</button></a>\n	    </div>\n    </div>\n    {/if}\n\n    <div class=\"fixed-footer-bottom-trigger\"></div>\n\n    <footer {if  last_segment==\'mas_de_15k\' OR last_segment==\'menor_de_10k\' OR last_segment == \'entre_10k_y_15k\' OR last_segment==\'gracias_phone\' OR last_segment==\'gracias\'} class=\"naranja\" {/if}>\n        <div id=\"curve\" class=\"hide-for-small-only {if last_segment==\'mas_de_15k\' OR last_segment==\'menor_de_10k\' OR last_segment == \'entre_10k_y_15k\' OR last_segment==\'gracias_phone\' OR last_segment==\'gracias\'}naranja {/if}\"></div>\n        <div class=\"row\">\n            <div class=\"large-10 large-uncentered medium-10 medium-uncentered small-10 small-centered columns\">\n                <ul class=\"inline-list\">\n                    <li>\n                        <a href=\"http://www.facebook.com/LaPositivaSeguros\" target=\"_blank\"><span {if  last_segment==\'mas_de_15k\' OR last_segment==\'menor_de_10k\' OR last_segment == \'entre_10k_y_15k\' OR last_segment==\'gracias_phone\' OR last_segm