s=\"large-5 large-centered medium-6 medium-centered small-10 small-centered text-center columns\">\n                <br>\n                <a href=\"{site_url}\" class=\"button button-orange\">VOLVER A COTIZAR</a>\n            </div>\n\n            {/exp:get_post_vars}\n        </div>\n    </section>\n{embed=\"includes/footer\"}\n\n{exp:get_post_vars parse=\"inward\"}\n{exp:send_email \n        from_name=\"La Positiva Seguros\" \n        from_email=\"lineapositiva@lapositiva.com.pe\" \n        to=\"lineapositiva@lapositiva.com.pe\" \n        subject=\"Cotización Pack Vehicular La Positiva\"\n    }\n    Por favor contactar al usuario {post_name} {post_surname} al teléfono {post_phone}. El usuario ha realizado la siguiente cotización del seguro Pack Vehicular:<br>\n    <br>\n    <b>Datos del vehículo cotizado:</b><br>\n    <br>\n       * Marca: {post_brand}<br>\n       * Modelo: {post_model}<br>\n       * Versión: {post_version}<br>\n       * Año: {post_ano}<br>\n       * Valor comercial del auto: US$ {post_precio}<br> \n    <br>\n    <b>Datos de coberturas seleccionadas y prima mensual:</b><br>\n        <br>   \n         * Pérdida Total por robo : S/. {post_ptr} mensuales.<br>\n         * Pérdida Total por choque : S/. {post_ptch} mensuales.<br>\n         * Daño propio por choque : S/. {post_dpch} mensuales.<br>\n         * Responsabilidad Civil : S/. {post_respci} mensuales.<br>\n    <br>\n        Prima Total: <b>S./ {post_total_prima} mensuales.</b> <br>\n    <br>\n    En caso no puedan contactarlo por teléfono, por favor escribirle al correo <b>{post_email}</b>\n{/exp:send_email} \n\n{exp:send_email \n        from_name=\"La Positiva Seguros\" \n        from_email=\"lineapositiva@lapositiva.com.pe\" \n        to=\"{post_email}\" \n        subject=\"Cotización Pack Vehicular La Positiva\"\n    }\nHola {post_name} {post_surname},<br>\n<br>\nMuchas gracias por cotizar tu Pack Vehicular de La Positiva.<br>\n<br>\nEn breve te estaremos contactando para completar el proceso de venta.<br>\n<br>\n    Los detalles de tu cotización son los siguientes:<br>\n    <br>\n    <b>Datos del vehículo cotizado:</b><br>\n    <br>\n       * Marca: {post_brand}<br>\n       * Modelo: {post_model}<br>\n       * Versión: {post_version}<br>\n       * Año: {post_ano}<br>\n       * Valor comercial del auto: US$ {post_precio}<br> \n    <br>\n    <b>Datos de coberturas seleccionadas y prima mensual:</b><br>\n        <br>\n        * Responsabilidad Civil : S/. {post_respci} mensuales.<br>\n        * Pérdida por robo : S/. {post_ptr} mensuales.<br>\n        * Pérdida por choque :  S/. {post_ptch} mensuales.<br> \n        * Daños propios por choque : S/. {post_dpch} mensuales.<br> \n    <br>\n        Prima Total: <b>S./ {post_total_prima} mensuales.</b> <br>\n    <br>\n    <b>Datos del propietario:</b><br>\n        * Nombre: {post_name} {post_surname}<br>\n        * Teléfono: {post_phone}<br>\n    <br>\n    Si tienes alguna duda o si este correo te ha llegado sin haber realizado una cotización en línea, por favor escríbenos al siguiente correo: lineapositiva@lapositiva.com o llámanos al 211-0212 desde Lima o al 749001 desde provincias.<br>\n    <br>\n    Muchas gracias,<br>\n    <br>\n    El equipo de La Positiva Seguros<br>\n    www.lapositiva.com.pe<br>\n    <br>\n{/exp:send_email} \n\n{/exp:get_post_vars}'),(91,13,'exp_templates','template_data',1393879857,2,'{embed=\"includes/header\"}\n    {exp:get_post_vars parse=\"inward\"}\n    <section id=\"second-section\">\n        <div class=\"row\">\n            <div class=\"large-12 columns text-center\">\n                <p>EL VALOR DE TU</p>\n                <h2>{post_marca} {post_version}, {post_ano}</h2>\n                <p>ES DE</p>\n                <h3>US$ {exp:number_formatter:format decimals=\'0\' dec_point=\'.\' thousands_sep=\',\'}{post_precio}{/exp:number_formatter:format}<!-- <span id=\"low-price\">.00</span> --></h3>\n            </div>\n        </div>\n    </section>\n    {/exp:get_post_vars}\n    <section id=\"fourth-section\">\n        <div class=\"row\">\n            <div id=\"auto-seguro\" class=\"large-4 large-uncentered medium-6 medium-centered small-10 small-centered text-center columns\">\n                <!-- <a href=\"#\" class=\"info-tooltip\" data-reveal-id=\"pack-total\">?</a> -->\n                <p>AUTO TOTAL POSITIVA</p>\n            </div>\n            <div id=\"auto-seguro-msg\" class=\"large-8 large-uncentered medium-6 medium-centered small-10 small-centered columns\">\n                <p>EL VALOR COMERCIAL DE TU AUTO ESTÁ POR ENCIMA DE LA SUMA ASEGURABLE DE NUESTRO PRODUCTO PACK VEHICULAR, POR LO QUE TE OFRECEMOS NUESTRO SEGURO <span class=\"orange\"><b>AUTO TOTAL POSITIVA</b></span>, EL CUAL PERMITE ASEGURAR TU AUTO CONTRA <span class=\"orange\"><b>TODO RIESGO</b></span>.</p>\n                <p class=\"text-center\">\n                    <a href=\"http://www.lapositiva.com.pe/generales/jerarquia/730/auto-total-positiva/jer.730\" class=\"button button-orange\" target=\"_blank\">MÁS INFORMACIÓN</a>\n                </p>\n            </div>\n        </div>\n    </section>\n{embed=\"includes/footer\"}'),(92,8,'exp_templates','template_data',1393879857,2,'{exp:get_post_vars parse=\"inward\"}\n		{exp:filtros:agency distrito=\"{post_distrito}\"}\n		{/exp:filtros:agency}\n{/exp:get_post_vars}'),(93,6,'exp_templates','template_data',1393879857,2,'{exp:get_post_vars parse=\"inward\"}\n		{exp:filtros:year version=\"{post_version}\" modelo=\"{post_modelo}\" marca=\"{post_marca}\" }\n		{/exp:filtros:year}\n{/exp:get_post_vars}'),(98,17,'exp_templates','template_data',1398785090,1,'<!DOCTYPE html>\n<!--[if IE 8]> <html class=\"no-js lt-ie9\" lang=\"en\" xmlns:fb=\"http://ogp.me/ns/fb#\"> <![endif]-->\n<!--[if gt IE 8]><!--> <html class=\"no-js\" lang=\"es\" xmlns:fb=\"http://ogp.me/ns/fb#\"> <!--<![endif]-->\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\'viewport\' content=\'width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalab