get_ptch} mensuales. <br>\n{/if}\n{if {get_dpch} != 0 }\n * Daños propios por choque : S/. {get_dpch} mensuales. <br>\n{/if}\n<br>\n Prima Total: <b>S./ {get_tp} mensuales.</b> <br>\n<br>\n<b>Datos del propietario:</b><br>\n * Nombre: {get_a} {get_b}<br>\n * Teléfono: {get_c}<br>\n<br>\nSi tienes alguna duda o si este correo te ha llegado sin haber realizado una cotización en línea, por favor escríbenos al siguiente correo: lineapositiva@lapositiva.com o llámanos al 211-0212 desde Lima o al 749001 desde provincias.<br>\n<br>\nMuchas gracias,<br>\n<br>\nEl equipo de La Positiva Seguros <br>\nwww.lapositiva.com.pe<br>\n</div>\n</div>\n<br>\n<div style=\"text-align:right;\">\n	 <img src=\"{site_url}/img/rabito1.png\" width=\"150\"alt=\"la-postiva\">\n</div>\n<div style=\"color:#FF5522;text-align:center;\">\n	<p style=\"font-size: 75%;\">Lima - Cusco - Piura - Arequipa - Cajamarca - Ica - Chiclayo - Iquitos - Puno - Lambayeque - Trujillo - Tacna - Ucayali - Junin - Ancash</p>\n</div>\n{/exp:get_post_vars}\n',NULL,1393879857,2,'n',0,'','n','y','o',862),(16,1,3,'index','n','webpage','',NULL,1389807398,0,'n',0,'','n','n','o',2),(17,1,3,'header','y','webpage','<!DOCTYPE html>\n<!--[if IE 8]> <html class=\"no-js lt-ie9\" lang=\"en\" xmlns:fb=\"http://ogp.me/ns/fb#\"> <![endif]-->\n<!--[if gt IE 8]><!--> <html class=\"no-js\" lang=\"es\" xmlns:fb=\"http://ogp.me/ns/fb#\"> <!--<![endif]-->\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\'viewport\' content=\'width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no\' />\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=EmulateIE9\"/>\n    <meta name=\"description\" content=\"Acabo de cotizar un seguro para mi auto. Cotízalo tu también desde S/. 19 mensuales.\" />\n    <meta name=\"keywords\" content=\"postiva, seguros, vehicular, soat, promoción\" />\n    <meta name=\"author\" content=\"La Positiva Seguros\" />\n    <meta name=\"copyright\" content=\"La Positiva Seguros\" />\n    <meta name=\"appli