olid windowtext 1.0pt;\n      background:white;padding:0cm 3.5pt 0cm 3.5pt;height:13.4pt\">\n      <p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\n      text-align:center;line-height:normal\"><span lang=\"ES-PE\" style=\"mso-ascii-font-family:\n      Calibri;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-font-family:Calibri;\n      mso-bidi-font-family:&quot;Times New Roman&quot;;color:black;mso-fareast-language:ES-PE\">S/. 3,000.00\n      <o:p></o:p></span></p>\n      </td>\n     </tr>\n    </tbody></table>\n    <a class=\"close-reveal-modal\">&#215;</a>\n</div>\n\n<div id=\"asistencia-vial\" class=\"reveal-modal\" data-reveal>\n    <p>La cobertura de Asistencia Vial cubre:</p>\n    <br>\n    <p><b>a)</b> Servicio de Auxilio Mecánico: Llaves en el interior, cambio de llanta, se quedó sin gasolina, recarga de batería.</p>\n    <p><b>b)</b> Servicio de Remolque (para vehículos de un máximo de 2 toneladas): Auto no enciende, no tienen llanta de repuesto, choque, etc.</p>\n    <p><b>c)</b> Chofer de reemplazo: Este servicio es válido solo para vehículos livianos en Lima Metropolitana.</p><br>\n    <p>Todas estas coberturas son gratuitas y máximo hasta 1 evento al año.</p>\n    <a class=\"close-reveal-modal\">&#215;</a>\n</div>\n\n<div id=\"banner-contactanos\" class=\"asistencia-vial reveal-modal\" data-reveal>\n    <img style=\"width:100%;\" src=\"{site_url}/img/banner.png\" alt=\"Contáctanos\">\n    <a class=\"close-reveal-modal\">&#215;</a>\n</div>','',1401916358,1,'n',0,'','n','n','o',2),(20,1,3,'fixed-footer','y','webpage','<section class=\"fixed-footer show-for-large-only\">\n    <div class=\"row\">\n        <form id=\"cotizar\" class=\"quote quote-fixed\" method=\"POST\" action=\"#\">\n            <input type=\"hidden\" name=\"XID\" value=\"{XID_HASH}\" /> \n            <div class=\"large-3 medium-3 hide-for-small-only columns\">\n                <span class=\"selector-big\">\n                    {exp:filtros:brand}\n                </span>\n            </div>\n            <div class=\"large-2 medium-2 hide-for-small-only columns\">\n                <span class=\"selector-big\">\n                    <select name=\"modelo\" id=\"modelo\">\n                      <option value=\"MODELO\" selected>MODELO</option>\n                    </select>\n                </span>\n            </div>\n            <div class=\"large-2 medium-2 hide-for-small-only columns\">\n                <span class=\"selector-big\">\n                    <select name=\"version\" id=\"version\">\n                      <option value=\"VERSIÓN\" selected>VERSIÓN</option>\n                    </select>\n                </span>\n            </div>\n            <div class=\"large-2 medium-2 hide-for-small-only columns\">\n                <span class=\"selector-big\">\n                    <select name=\"precio\" id=\"ano\">\n                      <option value=\"AÑO\" selected>AÑO</option>\n                    </select>\n                </span>\n            </div>\n            <div class=\"large-3 large-uncentered medium-3 medium-uncentered small-7 small-centered hide-for-small-only columns\">\n            <input id=\"form_ano\" type=\"hidden\" name=\"ano\">\n            <button class=\"expand\" type=\"submit\">COTIZAR OTRO VEHÍCULO</button>\n            </div>\n            <div class=\"small-9 small-centered columns show-for-small-only\">\n                <a href=\"{site_url}\" class=\"button\">COTIZAR OTRO VEHÍCULO</a>\n            </div>\n        </form>\n    </div>\n</section>','',1393879857,2,'n',0,'','n','n','o',0),(21,1,1,'gracias_phone','y','webpage','{embed=\"includes/header\"}\n\n<body class=\"antialiased\">\n    <section id=\"fifth-section\">\n        <div class=\"row\">\n            {exp:get_post_vars parse=\"inward\"}\n            <div class=\"large-8 large-centered medium-10 medium-centered small-10 small-centered text-center columns\">\n                <h1>{get_name} {get_surname}</h1>\n                {exp:registro:registrar_cliente marca=\"{post_brand}\" modelo=\"{post_model}\" version=\"{post_version}\" precio=\"{post_precio}\" ano=\"{post_ano}\" dni=\"{post_dni}\" name=\"{post_name}\" surname=\"{post_surname}\" email=\"{post_email}\" phone=\"{post_phone}\" res_ci=\"{post_respci}\" perd_robo=\"{post_ptr}\" perd_choque=\"{post_ptch}\" da_propios=\"{post_dpch}\"}{/exp:registro:registrar_cliente}\n                <p class=\"thanks-email\">{post_email}</p>\n            </div>\n\n            <div class=\"large-8 large-centered medium-10 medium-centered small-10 small-centered text-center columns\">\n                <p class=\"thanks-2nd-msg\">EN BREVE TE ESTAREMOS CONTACTANDO PARA COMPLETAR EL PROCESO DE VENTA. MUCHAS GRACIAS.</p>\n            </div>\n            <div class=\"row\">\n            <div class=\"large-5 large-centered medium-5 medium-centered small-12 columns\">\n                <!-- AddThis Button BEGIN -->\n                <div class=\"addthis_toolbox addthis_default_style\" >\n					<a class=\"addthis_button_facebook_like\" fb:like:layout=\"button_count\" addthis:url=\"{site_url}\" addthis:title=\"La Positiva Seguros\"  addthis:description=\"Acabo de cotizar un seguro para mi auto. Cotízalo tu también desde S/. 19 mensuales.\"></a>\n					<a style=\"width:5.8em;\" class=\"addthis_button_tweet\" tw:text=\"Acabo de cotizar un seguro para mi auto. Cotiza tu #PackVehicular desde S/. 19 mensuales.\" tw:via=\"LaPositiva_Peru\" addthis:url=\"{site_url}\"></a>\n					<a class=\"addthis_counter addthis_pill_style\" addthis:url=\"{site_url}\" addthis:title=\"Acabo de cotizar un seguro para mi auto. Cotiza tu #PackVehicular desde S/. 19 mensuales.\"  addthis:description=\"La Positiva Seguros\"></a>\n                </div>\n                <script type=\"text/javascript\">var addthis_config = {\"data_track_addressbar\":true};</script>\n				<script type=\"text/javascript\" src=\"//s7.addthis.com/js/300/addthis_widget.js#pubid=hermanmarin\"></script>\n                <!-- AddThis Button END -->\n            </div>\n            </div>\n            <div class=\"large-5 large-centered medium-6 medium-centered small-10 small-centered text-center columns\">\n                <br>\n                <a href=\"{site_url}\" class=\"button button-orange\">VOLVER A COTIZAR</a>\n            </div>\n\n            {/exp:get_post_vars}\n        </div>\n    </section>\n{embed=\"includes/footer\"}\n\n{exp:get_post_vars parse=\"inward\"}\n{exp:send_email \n        from_name=\"La Positiva Seguros\" \n        from_email=\"lineapositiva@lapositiva.com.pe\" \n        to=\"lineapositiva@lapositiva.com.pe\" \n        subject=\"Cotización Pack Vehicular La Positiva\"\n    }\n    Por favor contactar al usuario {post_name} {post_surname} al teléfono {post_phone}. El usuario ha realizado la siguiente cotización del seguro Pack Vehicular:<br>\n    <br>\n    <b>Datos del vehículo cotizado:</b><br>\n    <br>\n       * Marca: {post_brand}<br>\n       * Modelo: {post_model}<br>\n       * Versión: {post_version}<br>\n       * Año: {post_ano}<br>\n       * Valor comercial del auto: US$ {post_precio}<br> \n    <br>\n    <b>Datos de coberturas seleccionadas y prima mensual:</b><br>\n        <br>   \n         * Pérdida Total por robo : S/. {post_ptr} mensuales.<br>\n         * Pérdida Total por choque : S/. {post_ptch} mensuales.<br>\n         * Daño propio por choque : S/. {post_dpch} mensuales.<br>\n         * Responsabilidad Civil : S/. {post_respci} mensuales.<br>\n    <br>\n        Prima Total: <b>S./ {post_total_prima} mensuales.</b> <br>\n    <br>\n    En caso no puedan contactarlo por teléfono, por favor escribirle al correo <b>{post_email}</b>\n{/exp:send_email} \n\n{exp:send_email \n        from_name=\"La Positiva Seguros\" \n        from_email=\"lineapositiva@lapositiva.com.pe\" \n        to=\"{post_email}\" \n        subject=\"Cotización Pack Vehicular La Positiva\"\n    }\nHola {post_name} {post_surname},<br>\n<br>\nMuchas gracias por cotizar tu Pack Vehicular de La Positiva.<br>\n<br>\nEn breve te estaremos contactando para completar el proceso de venta.<br>\n<br>\n    Los detalles de tu cotización son los siguientes:<br>\n    <br>\n    <b>Datos del vehículo cotizado:</b><br>\n    <br>\n       * Marca: {post_brand}<br>\n       * Modelo: {post_model}<br>\n       * Versión: {post_version}<br>\n       * Año: {post_ano}<br>\n       * Valor comercial del auto: US$ {post_precio}<br> \n    <br>\n    <b>Datos de coberturas seleccionadas y prima mensual:</b><br>\n        <br>\n        * Responsabilidad Civil : S/. {post_respci} mensuales.<br>\n        * Pérdida por robo : S/. {post_ptr} mensuales.<br>\n        * Pérdida por choque :  S/. {post_ptch} mensuales.<br> \n        * Daños propios por choque : S/. {post_dpch} mensuales.<br> \n    <br>\n        Prima Total: <b>S./ {post_total_prima} mensuales.</b> <br>\n    <br>\n    <b>Datos del propietario:</b><br>\n        * Nombre: {post_name} {post_surname}<br>\n        * Teléfono: {post_phone}<br>\n    <br>\n    Si tienes alguna duda o si este correo te ha llegado sin haber realizado una cotización en línea, por favor escríbenos al siguiente correo: lineapositiva@lapositiva.com o llámanos al 211-0212 desde Lima o al 749001 desde provincias.<br>\n    <br>\n    Muchas gracias,<br>\n    <br>\n    El equipo de La Positiva Seguros<br>\n    www.lapositiva.com.pe<br>\n    <br>\n{/exp:send_email} \n\n{/exp:get_post_vars}',NULL,1393879857,2,'n',10,'','n','y','o',301),(22,1,1,'pop-ups','y','webpage','{embed=\"includes/header\"}\n<div class=\"row pop-up-div\">\n    <div class=\"large-10 large-centered medium-10 medium centered small-10 small-centered columns\">\n        <div id=\"perdida-robo\">\n            <p class=\"lead\"><b>Pérdida Total por Robo:</b></p>\n            <p>Esta cobertura cubre el valor comercial del vehículo en caso este sea robado.</p>\n            <p>Los daños sufridos por el vehículo a causa de un robo deben ser equivalentes al 75% o más del valor nuevo del vehículo asegurado o de uno similar en sus características técnicas en la fecha de ocurrido el siniestro.</p>\n            <p class=\"italic\">Deducible: 10% del monto indemnizable.</p>\n        </div>\n\n        <hr>\n\n        <div id=\"perdida-choque\">\n            <p class=\"lead\"><b>Pérdida Total por Choque:</b></p>\n            <p>Esta cobertura cubre el valor comercial del vehículo en caso de choque.</p>\n            <p>Los daños sufridos por el vehículo a causa de un accidente deben ser equivalentes al 75% o más del valor nuevo del vehículo asegurado o de uno similar en sus características técnicas en la fecha de ocurrido el siniestro.</p>\n            <p class=\"italic\">Deducible: 10% del monto indemnizable.</p>\n        </div>\n\n        <hr>\n\n        <div id=\"propio-choque\">\n            <p class=\"lead\"><b>Daño Propio por Choque:</b></p>\n            <p>Esta cobertura cubre la reparación del vehículo asegurado en caso de choque hasta por S/. 30,000.</p>\n            <p>La cobertura es aplicable sólo a talleres multimarcas autorizados por La Positiva. Esta cobertura también se extiende a cubrir los daños del vehículo de un tercero causados por el vehículo asegurado hasta por el monto de la suma asegurada.</p>\n            <p class=\"italic\">Deducible: S./ 2,400.</p>\n        </div>\n\n        <hr>\n\n        <div id=\"responsabilidad-civil\">\n            <p class=\"lead\"><b>Responsabilidad Civil:</b></p>\n            <p>Esta cobertura cubre la Responsabilidad Civil en que incurra el Asegurado o cualquier otra persona que conduzca el vehículo asegurado con su autorización, que sea consecuencia de un accidente y que ocasione lesiones y/o daños materiales a personas o cosas que se encuentren fuera del vehículo, hasta la suma asegurada contratada.</p>\n            <p class=\"italic\">Deducible: 10% del monto indemnizable, mínimo S/. 300.</p>\n        </div>\n\n        <hr>\n\n        <div id=\"terms-2\">\n            <h4 class=\"text-center\"><b>Términos y Condiciones</b></h4>\n            <p class=\"lead\"><b>Unidades Asegurables.</b></p>\n            <p>Las clases de vehículos para este programa son Vehiculos Livianos de cualquier procedencia con timón original o timón cambiado a excepción de los señalados en el listado de vehiculos no asegurables.\n        Vehículos Livianos: Automóviles, camionetas Station Wagon, Camionetas Panel, Camionetas rurales hasta 9 asientos.</p>\n            <p class=\"lead\"><b>Condiciones</b></p>\n            <p>Uso - Programa exclusivo para uso particular.</p>\n            <p>Antigüedad - Válido para vehículos Livianos hasta 20 años de antigüedad para Pérdida Total.</p>\n            <p>Valor Comercial - Programa válido para Vehículos Livianos hasta S/.45,000</p>\n            <p class=\"lead\"><b>Vehículos no asegurables</b></p>\n            <p><b>Dodge</b> - En sus modelos Nitro, Ram.</p>\n            <p><b>Ferrari</b> - En todos sus modelos.</p>\n            <p><b>Hyundai</b> - Tiburon.</p>\n            <p><b>Hummer</b> - En todos sus modelos.</p>\n            <p><b>Jaguar</b> - En todos sus modelos.</p>\n            <p><b>Mazda</b> - En su modelo RX (cualquier versión).</p>\n            <p><b>Mini Cooper</b> - En todos sus modelos.</p>\n            <p><b>Mitsubishi</b> - En sus modelos Lancer Evolution (cualquier versiónn), Eclipse, 3000, 3000GT, Diamante.</p>\n            <p><b>Nissan</b> - En sus modelos Lucino, 240, 280, 350z, 370z, Skyline.</p>\n            <p><b>Opel Vita</b> - En todos sus modelos.</p>\n            <p><b>Seat</b> - En sus modelos León e Ibiza y en cualquier versión Fr y Cupra.</p>\n            <p><b>Subaru</b> - En sus modelos Impreza Turbo, Impreza WRX (cualquier versión), Impreza GT.</p>\n						<p><b>AUDI R8</b></p>\n						<p><b>BMW</b> -  ActiveHybrid</p>\n						<p><b>CHEVROLET</b> -  Camaro</p>\n						<p><b>DOGDE</b> -  en sus modelos Challenger, Charger, Nitro y Ram</p>\n						<p><b>FERRARI</b> -  en todos sus modelos</p>\n						<p><b>FORD</b> -  Mustang</p>\n						<p><b>HONDA</b> -  Hybrid</p>\n						<p><b>HYUNDAI</b> -  en sus modelos Coupe, Eclipse, Genesis, Genesis Coupe, Tiburón, Veloster</p>\n						<p><b>HUMMER</b> -  en todos sus modelos</p>\n						<p><b>INFINITY</b> -  en todos sus modelos</p>\n						<p><b>JAGUAR</b> -  en todos sus modelos</p>\n						<p><b>LEXUS</b> -  en todos sus modelos</p>\n						<p><b>MAZDA</b> -  en sus modelos MX-5, RX (cualquier versión)</p>\n						<p><b>MINI COOPER</b> -  en todos sus modelos</p>\n						<p><b>MITSUBISHI</b> -  en sus modelos  Diamante, Eclipse, Evolution, Lancer Evolution (cualquier versión), 3000, 3000GT</p>\n						<p><b>NISSAN</b> -  en sus modelos Lucino, Skyline, 240, 280, 350Z, 370Z</p>\n						<p><b>OPEL VITA</b> -  en todos sus modelos</p>\n						<p><b>PORSCHE</b> -  en todos sus modelos</p>\n						<p><b>PEUGEOT</b> -  en sus modelos Cabriolet, CC y GTI</p>\n						<p><b>SEAT</b> -  en sus modelos Ibiza y León en cualquier versión FR y Cupra</p>\n						<p><b>SUBARU</b> -  en sus modelos BRZ, Impreza GT, Impreza Turbo, Impreza STI, Impreza STI  WRX e Impreza WRX (cualquier versión)</p>\n						<p><b>TOYOTA</b> -  en sus modelos Celica, Chaser, Corolla GT, Corona Exiv, Cresta, Curren, Cynos,  Estima (Lucida y Emina), Hachiroku, Mark II, Paseo, Prius Probox, Scion, Sienta, Soarer, Supra, Succeed, Vista, 86GT</p>\n						<p><b>VOLKSWAGEN GTI</b></p>\n						<p><b>VEHÍCULOS DESCAPOTABLES</b> - (Convertibles).</p>\n						<p><b>VEHÍCULOS HÍBRIDOS</b></p>\n						<p><b>VEHÍCULOS CON PUERTAS DE APERTURA VERTICAL (LSD DOORS)</b></p>\n						<p>CUALQUIER VEHÍCULO DE COMPETENCIA O PREPARADO PARA COMPETIR.</p>            \n\n            <p class=\"lead\"><b>Exclusiones</b></p>\n            <ol>\n                <li>Daños a y por la carga transportada.</li>\n                <li>Daños a conyuge y a parientes del Asegurado, sólo para el caso de responsabilidad civil.</li>\n                <li>Daños intencionales.</li>\n                <li>Responsabilidad penal.</li>\n                <li>Guerra civil o internacional, contaminación radioactiva</li>\n                <li>Daños a terceros cuando el vehículo haya sido robado.</li>\n                <li>Daños a terceros cuando el vehículo es dedicado a la enseñanza de conducción o participación en competencias automovilísticas.</li>\n                <li>Falta de licencia de conducir y/o cuando el Asegurado comete infracción muy grave según el Reglamento Nacional de Tránsito.</li>\n                <li>Conducción bajo los efectos de alcohol y drogas.</li>\n            </ol>\n            <p class=\"lead\"><b>Disposiciones Finales</b></p>\n            <ol>\n                <li>Las presentes condiciones prevalecen sobre las Condiciones Generales del Seguro de Vehículos.</li>\n                <li>El Asegurado tiene derecho a solicitar, copia de la póliza del seguro a La Positiva, la cual deberá ser entregada en un plazo máximo de quince (15) días calendario desde la recepción de la solicitud presentada por el Asegurado.</li>\n                <li>La cobertura de esta póliza será la que corresponda al de la prima pagada.</li>\n                <li>La póliza y la relación de talleres multimarca se encuentran disponibles en www.lapositiva.com.pe</li>\n                <li>No son asegurables bajo ningún caso vehículos de timón cambiado o aquellos de alto riesgo según las políticas de suscripción de la Gerencia Técnica de La Positiva Seguros.</li>\n                <li>La existencia de dos o más pólizas cubriendo el mismo riesgo implica la aplicación del artículo 90 de la Ley del Contrato de Seguro, estando obligado el contratante a actuar conforme a lo establecido en el primer párrafo de dicho artículo.</li>\n                <li>El presente producto presenta obligaciones a cargo del usuario cuyo incumplimiento podría afectar el pago de la indemnización o prestaciones a las que se tendría derecho.</li>\n                <li>Dentro de la vigencia del contrato de seguro, el Asegurado se encuentra obligado a informar a la empresa los hechos o circunstancias que agraven el riesgo asegurado.</li>\n                <li>El Asegurado podrá resolver el contrato de seguro sin expresión de causa, dentro de los 15 primeros días siguientes a la fecha en que recibe la póliza, procediendo La Positiva a devolver la prima recibida (Derecho de Arrepentimiento).</li>\n                <li>El Asegurado autoriza a La Positiva la remisión de toda la información vinculada a la póliza de seguro que ha adquirido, a la dirección electróni- ca consignada en este documento.</li>\n                <li>El Asegurado mediante la firma de este documento declara bajo juramento la tenencia del vehículo al momento de la afiliación al seguro, así como el buen estado del mismo bajo las condiciones de operatividad establecidas por el fabricante.</li>\n            </ol>\n\n            <hr>\n\n            <h4 class=\"text-center\"><b>Resumen Informativo del Seguro de Vehículos</b></h4>\n            <p class=\"lead\"><b>Riesgos Cubiertos</b></p>\n            <p>Cubre los riesgos especificados en las Condiciones Particulares de la Póliza, en los términos señalados en el Capítulo II (Cobertura) de las Condiciones Generales del Seguro de Vehículos.</p>\n            <p class=\"lead\"><b>Exclusiones</b></p>\n            <p>Se detallan en las Condiciones Particulares de la Póliza, en los términos señalados en el Capítulo III (Cobertura) de las Condiciones Generales del Seguro de Vehículos.</p>\n            <p class=\"lead\"><b>Causales de Resolución del Contrato</b></p>\n            <p>Se encuentran señaladas en el numeral 1.2 (Pago de Primas) y en el numeral 1.8 (Resolución de Contrato) de las Condiciones Generales del Seguro de Vehículos.</p>\n            <p class=\"lead\"><b>Medio y plazo establecidos para el aviso del siniestro</b></p>\n            <p>A través de Línea Positiva llamando al 211-0-211 desde Lima o al 74-9000 desde provincias (deberá marcar el código de provincias previamente), dentro de las 72 horas de ocurrido el siniestro.</p>\n            <p class=\"lead\"><b>Procedimiento y lugares para la Solicitud de Cobertura</b></p>\n            <p>Ocurrido el siniestro, el Beneficiario deberá presentar el reclamo a La Positiva, o a través de El Comercializador de la presente póliza debiendo entregar los documentos que acrediten la ocurrencia del siniestro y el importe de los daños sufridos. La omisión o el retardo sólo son excusables si medió fuerza mayor, caso fortuito o imposibilidad de hecho sin culpa o negligencia. Se deja expresa constancia que lo consignado en el presente numeral, en ningún caso limita el derecho del Asegurado de acudir a cualquier instancia judicial o administrativa, si así lo considerara pertinente.</p>\n            <p class=\"lead\"><b>Mecanismos de Solución de Controversias</b></p>\n            <p>Se encuentran previsto en el numeral 1.13 de las Condiciones Generales del Seguro de Vehículos.</p>\n            <p class=\"lead\"><b>Áreas Encargadas de Atender Reclamos</b></p>\n            <p>La Positiva recibirá los reclamos de los Asegurados en su “Área de Servicio al Cliente” llamando al 211-0-211 desde Lima o al 74-9000 desde provincias (desde celular deberán marcar el código de provincias previamente), en cualquiera de sus oficinas a nivel nacional (relación de direccio- nes en la web: www.lapositiva.com.pe,) así como a través de la misma página web de La Positiva.</p>\n            <p class=\"lead\"><b>Instancias habilitadas para presentar reclamos y/o denuncias</b></p>\n            <p>Defensoría del Asegurado, Superintendencia, INDECOPI, entre otros, según corresponda.</p>\n            <p class=\"lead\"><b>Tratamiento de Datos Personales</b></p>\n            <p>El Contratante y el Asegurado autorizan de forma expresa a La Positiva Seguros y Reaseguros, el uso de los datos personales proporcionados en la contratación del presente seguro, para fines comerciales, tales como el envío de publicidad y promociones de diferentes productos o servicios; autorización que la extendemos en el marco de lo dispuesto en la Ley No 29733 y su Reglamento, aprobado por Decreto Supremo No 003-2013, que regulan el tratamiento de datos personales, y la posibilidad de que La Positiva Seguros y Reaseguros transfiera los mismos a sus empresas vinculadas.</p>\n        </div>\n\n        <hr>\n\n        <div id=\"pack-total\">\n            <p class=\"lead\"><b>Auto Total Positiva:</b></p>\n            <p>El valor comercial de tu auto está por encima de la suma asegurable de nuestro producto Pack Vehicular, para lo cual te ofrecemos nuestro producto integral Auto Total Positiva, el cual permite asegurar tu auto contra todo riesgo.</p>\n            <p>Para más información sobre el producto haz <a href=\"#\">click aquí</a>.</p>\n        </div>\n\n        <hr>\n\n        <div id=\"accidentes-personales\">\n            <p>El seguro de Accidentes personales cubre:</p>\n            <br><br>\n            <table class=\"MsoNormalTable\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"250\" style=\"width: 38em;border-collapse:collapse;mso-yfti-tbllook:1184;\n             mso-padding-alt:0cm 3.5pt 0cm 3.5pt;margin:0 auto;\">\n             <tbody><tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;height:33.75pt\">\n              <td width=\"250\" colspan=\"2\" style=\"width:250.0pt;border:solid windowtext 1.0pt;\n              border-right:solid black 1.0pt;mso-border-top-alt:windowtext 1.0pt;\n              mso-border-left-alt:windowtext 1.0pt;mso-border-bottom-alt:windowtext .5pt;\n              mso-border-right-alt:black 1.0pt;mso-border-style-alt:solid;background:#FF6600;\n              padding:0cm 3.5pt 0cm 3.5pt;height:33.75pt\">\n              <p class=\"MsoNormal\" align=\"center\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\n              text-align:center;line-height:normal\"><span lang=\"ES-PE\" style=\"mso-ascii-font-family:\n              Calibri;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-hansi-