tería.</p>\n            <p><b>b)</b> Servicio de Remolque (para vehículos de un máximo de 2 toneladas): Auto no enciende, no tienen llanta de repuesto, choque, etc.</p>\n            <p><b>c)</b> Chofer de reemplazo: Este servicio es válido solo para vehículos livianos en Lima Metropolitana.</p><br>\n            <p>Todas estas coberturas son gratuitas y máximo hasta 1 evento al año.</p>\n        </div>\n\n        <hr>\n\n        <div id=\"banner-contactanos\">\n            <img src=\"{site_url}/img/banner.png\" alt=\"Contáctanos\">\n        </div>\n    </div>\n</div>\n{embed=\"includes/footer\"}','',1401914984,1,'n',0,'','n','n','o',526),(23,1,1,'te_chocaron','y','webpage','{embed=\"includes/header\"}\n    <section id=\"first-section\">\n        <div class=\"row\">\n            <div class=\"large-12 text-center columns\">\n                <h1 id=\"primary\">¿TE CHOCARON?</h1>\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"large-10 large-centered columns\">\n                <div class=\"row\">\n                    <div id=\"price-msg\" class=\"large-6 small-12 columns\">\n                        <p>ASEGURA TU AUTO DESDE</p>\n                    </div>\n                    <div id=\"price\" class=\"large-5 large-uncentered medium-6 medium-centered small-12 small-centered columns\">\n                        <!-- <p class=\"price-first\">S/.</p> -->\n                        <p class=\"price-quantity\">S/. 19</p>\n                        <p class=\"price-montly\">MENSUALES</p>\n                    </div>\n                </div>\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"large-12 text-center medium-9 small-10 small-centered columns\">\n                <img src=\"{site_url}/img/choque.png\" alt=\"car\">\n            </div>\n        </div>\n\n        <div class=\"row full-width\">\n            <div class=\"large-12 large-uncentered medium-10 medium-centered small-12 small-centered